write_file({'path': 'design/spec.requirements.json', 'content': '{
  "project_name": "Voyager (Expedia-style Travel Booking)",
  "description": "Full-featured travel booking platform supporting flights, hotels, car rentals, packages, cart/checkout, and trip management.",
  "testing_urls": {
    "frontend": "http://localhost:8005",
    "backend": "http://localhost:8000"
  },
  "ui_theme": {
    "style": "Modern Expedia-inspired",
    "primary_color": "#1668E3",
    "accent_color": "#F6C343",
    "background": "#FFFFFF",
    "layout": "Responsive, card-based, clean whitespace",
    "components": [
      "Tab navigation: Stays / Flights / Cars / Packages",
      "Autocomplete location inputs with icons",
      "Interactive date picker calendar",
      "Hotel image carousel",
      "Heart favorites",
      "VIP Access badge",
      "Filters sidebar + sort dropdown",
      "Price breakdown panel in cart/checkout"
    ]
  },
  "tech_stack": {
    "frontend": {
      "framework": "React",
      "bundler": "Vite",
      "styling": "TailwindCSS",
      "state": "React Context + hooks (auth/cart)"
    },
    "backend": {
      "runtime": "Node.js",
      "framework": "Express",
      "auth": "JWT (Bearer) + bcrypt",
      "db": "node-postgres (pg)"
    },
    "database": "PostgreSQL"
  },
  "features": [
    {
      "name": "Authentication",
      "priority": "P0",
      "description": "Email/password registration and login, JWT auth, profile management, booking history."
    },
    {
      "name": "Flights",
      "priority": "P0",
      "description": "Search flights (one-way/round-trip), filters/sort, details, seat class selection, add to cart."
    },
    {
      "name": "Hotels",
      "priority": "P0",
      "description": "Search hotels, filters, details with photos and room selection, reviews/ratings, map view (static/placeholder map acceptable)."
    },
    {
      "name": "Cars",
      "priority": "P1",
      "description": "Search cars, filters, details, add extras, add to cart."
    },
    {
      "name": "Packages",
      "priority": "P1",
      "description": "Bundle flight+hotel+car with discount; compare package vs individual."
    },
    {
      "name": "Cart & Checkout",
      "priority": "P0",
      "description": "Multi-item cart, taxes/fees breakdown, promo codes, payment form (mock payment processing), place booking(s)."
    },
    {
      "name": "Trip Management",
      "priority": "P0",
      "description": "View upcoming/past trips, download confirmation (PDF generation optional; can provide HTML/printable), cancel/modify bookings (modify can be limited to cancel + rebook)."
    },
    {
      "name": "Favorites",
      "priority": "P2",
      "description": "Heart/favorite hotels and flights (optional persistence)."
    }
  ],
  "pages": [
    {
      "name": "Home",
      "path": "/",
      "description": "Hero search with tabs (Stays/Flights/Cars/Packages), date pickers, autocomplete, CTA to search results.",
      "components": ["TopNav", "SearchTabs", "LocationAutocomplete", "DateRangePicker", "PassengersRoomsPicker"]
    },
    {
      "name": "Auth - Login",
      "path": "/login",
      "description": "Login form; store JWT; redirect back.",
      "components": ["LoginForm"]
    },
    {
      "name": "Auth - Register",
      "path": "/register",
      "description": "Registration form.",
      "components": ["RegisterForm"]
    },
    {
      "name": "Flights Search Results",
      "path": "/flights",
      "description": "Flight results list with filters and sort; select flight and seat class.",
      "components": ["FiltersSidebar", "SortDropdown", "FlightCard"]
    },
    {
      "name": "Flight Details",
      "path": "/flights/:id",
      "description": "Flight detail view; seat class selection; add to cart.",
      "components": ["FlightDetail", "SeatClassSelector"]
    },
    {
      "name": "Hotels Search Results",
      "path": "/hotels",
      "description": "Hotel results list with filters, sort, favorites, VIP badges.",
      "components": ["HotelCard", "FiltersSidebar", "SortDropdown"]
    },
    {
      "name": "Hotel Details",
      "path": "/hotels/:id",
      "description": "Hotel detail with gallery carousel, amenities, reviews, room types; add to cart.",
      "components": ["ImageCarousel", "AmenitiesList", "RoomTypeSelector", "ReviewsSummary"]
    },
    {
      "name": "Cars Search Results",
      "path": "/cars",
      "description": "Car results list with filters and sort.",
      "components": ["CarCard", "FiltersSidebar", "SortDropdown"]
    },
    {
      "name": "Car Details",
      "path": "/cars/:id",
      "description": "Car detail with extras selection; add to cart.",
      "components": ["CarDetail", "ExtrasSelector"]
    },
    {
      "name": "Packages",
      "path": "/packages",
      "description": "Package builder: choose flight/hotel/car, show discount and comparison.",
      "components": ["PackageBuilder", "PriceComparison"]
    },
    {
      "name": "Cart",
      "path": "/cart",
      "description": "View cart items; apply promo code; see taxes/fees; proceed to checkout.",
      "components": ["CartItemList", "PromoCodeForm", "PriceBreakdown"]
    },
    {
      "name": "Checkout",
      "path": "/checkout",
      "description": "Traveler/guest details + payment form; place booking; confirmation.",
      "components": ["TravelerForm", "PaymentForm", "OrderSummary"]
    },
    {
      "name": "Trips",
      "path": "/trips",
      "description": "Upcoming and past trips; cancel booking; download confirmation.",
      "components": ["TripsList", "TripCard"]
    },
    {
      "name": "Profile",
      "path": "/profile",
      "description": "Manage name/email/phone and saved payment methods (masked).",
      "components": ["ProfileForm", "PaymentMethods"]
    }
  ],
  "api_endpoints": [
    {"method": "GET", "path": "/health", "description": "Health check", "auth_required": false},

    {"method": "POST", "path": "/auth/register", "description": "Register user", "auth_required": false},
    {"method": "POST", "path": "/auth/login", "description": "Login user, returns JWT", "auth_required": false},
    {"method": "GET", "path": "/auth/me", "description": "Get current user profile", "auth_required": true},
    {"method": "PUT", "path": "/auth/me", "description": "Update profile (name, phone)", "auth_required": true},

    {"method": "GET", "path": "/flights", "description": "Search/list flights with query params (origin, destination, departDate, returnDate?, passengers, filters, sort)", "auth_required": false},
    {"method": "GET", "path": "/flights/:id", "description": "Flight details", "auth_required": false},

    {"method": "GET", "path": "/hotels", "description": "Search/list hotels with query params (location, checkIn, checkOut, guests, rooms, filters, sort)", "auth_required": false},
    {"method": "GET", "path": "/hotels/:id", "description": "Hotel details including rooms and photos", "auth_required": false},

    {"method": "GET", "path": "/cars", "description": "Search/list cars with query params (pickup, dropoff, startDate, endDate, filters, sort)", "auth_required": false},
    {"method": "GET", "path": "/cars/:id", "description": "Car details", "auth_required": false},

    {"method": "GET", "path": "/packages/quote", "description": "Compute package pricing/discount from selected items", "auth_required": false},

    {"method": "GET", "path": "/cart", "description": "Get current cart", "auth_required": true},
    {"method": "POST", "path": "/cart/items", "description": "Add item to cart (flight/hotel/car/package)", "auth_required": true},
    {"method": "PATCH", "path": "/cart/items/:itemId", "description": "Update cart item quantity/options (seat class, room type, extras)", "auth_required": true},
    {"method": "DELETE", "path": "/cart/items/:itemId", "description": "Remove item from cart", "auth_required": true},
    {"method": "POST", "path": "/cart/apply-promo", "description": "Apply promo code", "auth_required": true},

    {"method": "POST", "path": "/checkout", "description": "Create bookings from cart; payment mock; returns confirmation", "auth_required": true},

    {"method": "GET", "path": "/bookings", "description": "List user bookings (history)", "auth_required": true},
    {"method": "GET", "path": "/bookings/:id", "description": "Booking details", "auth_required": true},
    {"method": "POST", "path": "/bookings/:id/cancel", "description": "Cancel booking", "auth_required": true},
    {"method": "GET", "path": "/bookings/:id/confirmation", "description": "Download/return confirmation", "auth_required": true}
  ],
  "data_models": [
    {
      "entity": "users",
      "fields": {
        "id": "uuid",
        "email": "text unique",
        "password_hash": "text",
        "full_name": "text",
        "phone": "text",
        "created_at": "timestamptz"
      },
      "relationships": {
        "has_many": ["payment_methods", "carts", "bookings", "favorites"]
      }
    },
    {
      "entity": "payment_methods",
      "fields": {
        "id": "uuid",
        "user_id": "uuid fk users",
        "brand": "text",
        "last4": "text",
        "exp_month": "int",
        "exp_year": "int",
        "token": "text (mock token)",
        "created_at": "timestamptz"
      }
    },
    {
      "entity": "flights",
      "fields": {
        "id": "uuid",
        "origin": "text",
        "destination": "text",
        "airline": "text",
        "flight_number": "text",
        "depart_at": "timestamptz",
        "arrive_at": "timestamptz",
        "duration_minutes": "int",
        "stops": "int",
        "layover_airports": "text[]",
        "base_price_cents": "int"
      }
    },
    {
      "entity": "hotels",
      "fields": {
        "id": "uuid",
        "name": "text",
        "location": "text",
        "address": "text",
        "lat": "numeric",
        "lng": "numeric",
        "star_rating": "numeric",
        "review_score": "numeric",
        "review_count": "int",
        "amenities": "text[]",
        "description": "text",
        "vip_access": "bool",
        "distance_km": "numeric",
        "created_at": "timestamptz"
      },
      "relationships": {
        "has_many": ["hotel_photos", "hotel_rooms", "hotel_reviews"]
      }
    },
    {
      "entity": "hotel_rooms",
      "fields": {
        "id": "uuid",
        "hotel_id": "uuid fk hotels",
        "name": "text",
        "bed_configuration": "text",
        "max_guests": "int",
        "refundable": "bool",
        "breakfast_included": "bool",
        "nightly_price_cents": "int"
      }
    },
    {
      "entity": "cars",
      "fields": {
        "id": "uuid",
        "company": "text",
        "model": "text",
        "car_type": "text",
        "seats": "int",
        "transmission": "text",
        "fuel_type": "text",
        "base_price_per_day_cents": "int",
        "pickup_location": "text",
        "dropoff_location": "text"
      }
    },
    {
      "entity": "cart_items",
      "fields": {
        "id": "uuid",
        "cart_id": "uuid",
        "item_type": "enum: flight|hotel|car|package",
        "item_ref_id": "uuid",
        "quantity": "int",
        "options": "jsonb",
        "price_cents": "int"
      }
    },
    {
      "entity": "bookings",
      "fields": {
        "id": "uuid",
        "user_id": "uuid fk users",
        "status": "enum: confirmed|cancelled",
        "total_cents": "int",
        "currency": "text",
        "trip_start": "date",
        "trip_end": "date",
        "created_at": "timestamptz"
      },
      "relationships": {
        "has_many": ["booking_items"]
      }
    },
    {
      "entity": "booking_items",
      "fields": {
        "id": "uuid",
        "booking_id": "uuid fk bookings",
        "item_type": "enum: flight|hotel|car|package",
        "item_ref_id": "uuid",
        "details": "jsonb",
        "price_cents": "int"
      }
    },
    {
      "entity": "promo_codes",
      "fields": {
        "code": "text pk",
        "description": "text",
        "percent_off": "int",
        "active": "bool"
      }
    }
  ],
  "seed_data": {
    "volumes": {
      "flights": 50,
      "hotels": 30,
      "cars": 20
    },
    "test_user": {
      "email": "admin@expedia.com",
      "password": "admin123"
    },
    "notes": [
      "Seed realistic cities/airports and dates within next 90 days.",
      "Hotel photos can be URLs to public placeholder images.",
      "Reviews can be generated text with scores." 
    ]
  },
  "non_functional": {
    "security": ["bcrypt password hashing", "JWT expiration (e.g., 24h)", "CORS configured for frontend origin"],
    "performance": ["Basic pagination optional", "Server-side filtering/sorting"],
    "validation": ["Input validation on auth and checkout", "Consistent error format"]
  }
}
'})
